INSERT INTO `banners` VALUES ('9a74787e-42d3-469c-80b3-65f68151c937','{\"de\":\"Schicke Styles f\\u00fcr moderne Frauen \\u2013 Entdecken Sie unsere neueste Kollektion!\",\"fr\":\"Styles chics pour les femmes modernes - Explorez notre derni\\u00e8re collection\\u00a0!\",\"en\":\"Chic Styles for Modern Women - Explore Our Latest Collection!\"}','{\"de\":\"Entdecken Sie trendige Damenbekleidung, perfekt f\\u00fcr jeden Anlass. Kaufen Sie jetzt die neuesten Mode-Must-haves!\",\"fr\":\"D\\u00e9couvrez des v\\u00eatements pour femmes tendance, parfaits pour toutes les occasions. Achetez maintenant les derniers incontournables de la mode\\u00a0!\",\"en\":\"Discover trendy ladies\' clothing, perfect for every occasion. Shop now for the latest fashion must-haves!\"}','{\"url\": \"https://shoptopus.test/sample-store-data/sample-store-1/banner-1.jpg\", \"file_name\": \"banner-1.jpg\"}',1,'{\"de\":\"Entdecken\",\"fr\":\"D\\u00e9couvrir\",\"en\":\"Discover\"}','http://localhost:3000/categories/womans-clothing-1',1,0,'chic-styles-for-modern-women-explore-our-latest-collection',NULL,'2023-10-25 16:11:23','2023-10-25 16:11:24'),('9a74787f-3788-46a6-9cd9-3913d6d1c3c3','{\"de\":\"Steigern Sie Ihren Stil mit Herren-Sneakern \\u2013 holen Sie sich jetzt die angesagtesten Sneaker!\",\"fr\":\"Am\\u00e9liorez votre style avec des baskets pour hommes - Obtenez les chaussures les plus chaudes maintenant !\",\"en\":\"Step Up Your Style with Men\'s Sneakers - Get the Hottest Kicks Now!\"}','{\"de\":\"Erweitern Sie Ihr Schuhwerk mit unserer neuesten Herren-Sneaker-Kollektion. Komfort und Stil bei jedem Schritt. Jetzt einkaufen!\",\"fr\":\"Am\\u00e9liorez votre jeu de chaussures avec notre derni\\u00e8re collection de baskets pour hommes. Confort et style \\u00e0 chaque \\u00e9tape. Achetez maintenant!\",\"en\":\"Elevate your footwear game with our latest men\'s sneakers collection. Comfort and style in every step. Shop now!\"}','{\"url\": \"https://shoptopus.test/sample-store-data/sample-store-1/banner-2.jpg\", \"file_name\": \"banner-2.jpg\"}',1,'{\"de\":\"H\\u00f6r zu\",\"fr\":\"V\\u00e9rifiez-le\",\"en\":\"Check it out\"}','http://localhost:3000/categories/mens-footwear-sneakers-1',1,0,'step-up-your-style-with-mens-sneakers-get-the-hottest-kicks-now',NULL,'2023-10-25 16:11:24','2023-10-25 16:11:24'),('9a747880-03f9-4ce1-83cc-ea5900d09d52','{\"de\":\"2\\u00a0\\u00a3 Rabatt auf alle Herrenaccessoires!\",\"fr\":\"2\\u00a0\\u20ac de r\\u00e9duction sur tous les accessoires pour hommes\\u00a0!\",\"en\":\"\\u00a32 off from all men\'s accessories!\"}','{\"de\":\"Sparen Sie mehr bei Krawatten, Schmuck und Sonnenbrillen!\",\"fr\":\"\\u00c9conomisez davantage sur les cravates, les bijoux et les lunettes de soleil\\u00a0!\",\"en\":\"Save more on ties, jewellery and sunglasses!\"}','{\"url\": \"https://shoptopus.test/sample-store-data/sample-store-1/banner-3.jpg\", \"file_name\": \"banner-3.jpg\"}',1,'{\"de\":\"H\\u00f6r zu\",\"fr\":\"V\\u00e9rifiez-le\",\"en\":\"Check it out\"}','http://localhost:3000/categories/mens-accessories-1',1,0,'ps2-off-from-all-mens-accessories',NULL,'2023-10-25 16:11:24','2023-10-25 16:11:25');
