INSERT INTO `products` VALUES ('9a7477ec-d35c-4c2c-b4ca-7561477e0a93','{\"de\":\"Klassisches Baumwoll-T-Shirt\",\"fr\":\"T-shirt classique en coton\",\"en\":\"Classic Cotton T-Shirt\"}','classic-cotton-t-shirt','{\"de\":\"Zeitloser Stil in diesem klassischen Baumwoll-T-Shirt.\",\"fr\":\"Style intemporel dans ce t-shirt classique en coton.\",\"en\":\"Timeless style in this classic cotton t-shirt.\"}','{\"de\":\"Werten Sie Ihren l\\u00e4ssigen Look mit diesem klassischen Baumwoll-T-Shirt auf. Das zeitlose Design und die hochwertige Baumwolle machen es perfekt f\\u00fcr jeden Anlass. Ob f\\u00fcr einen Tagesausflug mit Freunden oder einen entspannten Abend, dieses T-Shirt bietet sowohl Stil als auch Komfort. Erh\\u00e4ltlich in verschiedenen Farben, passend zu Ihrem Look.\",\"fr\":\"Am\\u00e9liorez votre look d\\u00e9contract\\u00e9 avec ce t-shirt classique en coton. Son design intemporel et son coton de haute qualit\\u00e9 le rendent parfait pour toutes les occasions. Que ce soit pour une journ\\u00e9e entre amis ou une soir\\u00e9e d\\u00e9contract\\u00e9e, ce t-shirt offre \\u00e0 la fois style et confort. Disponible en diff\\u00e9rentes couleurs pour correspondre \\u00e0 votre look.\",\"en\":\"Elevate your casual look with this Classic Cotton T-Shirt. The timeless design and high-quality cotton make it perfect for any occasion. Whether for a day out with friends or a relaxed evening, this t-shirt offers both style and comfort. Available in various colors to match your look.\"}',16.99,'{\"de\":\"Zeitlose Eleganz\",\"fr\":\"\\u00c9l\\u00e9gance intemporelle\",\"en\":\"Timeless Elegance\"}','{\"de\":\"Perfekt f\\u00fcr ungezwungene Anl\\u00e4sse und entspannte Abende.\",\"fr\":\"Parfait pour les occasions d\\u00e9contract\\u00e9es et les soir\\u00e9es d\\u00e9tendues.\",\"en\":\"Perfect for casual occasions and relaxed evenings.\"}',1,0,229,150,'M-T001',0,220,'{\"url\": \"https://shoptopus.test/sample-store-data/sample-store-1/product-images/mens-t-shirts-1.jpg\", \"file_name\": \"mens-t-shirts-1.jpg\"}',NULL,NULL,'2023-10-25 16:09:47','2023-10-25 16:11:16'),('9a7477ee-d2f5-4baf-a7cb-4740c6f1efb0','{\"de\":\"Sportliches Performance-T-Shirt\",\"fr\":\"T-shirt de performance sportive\",\"en\":\"Sporty Performance T-Shirt\"}','sporty-performance-t-shirt','{\"de\":\"Verbessern Sie Ihr Training mit diesem bequemen Performance-T-Shirt.\",\"fr\":\"Am\\u00e9liorez votre entra\\u00eenement avec ce t-shirt performant et confortable.\",\"en\":\"Elevate your workout with this comfortable performance t-shirt.\"}','{\"de\":\"Werten Sie Ihren sportlichen Stil mit diesem sportlichen Performance-T-Shirt auf. Das feuchtigkeitsableitende Material und die bequeme Passform bieten Unterst\\u00fctzung beim Training oder bei sportlichen Aktivit\\u00e4ten. Ob zum Laufen oder Basketballspiel, dieses T-Shirt ist eine vielseitige Erg\\u00e4nzung Ihrer Sammlung.\",\"fr\":\"Am\\u00e9liorez votre style athl\\u00e9tique avec ce t-shirt Sporty Performance. Le tissu \\u00e9vacuant l&#39;humidit\\u00e9 et la coupe confortable offrent un soutien pendant les entra\\u00eenements ou les activit\\u00e9s sportives. Que ce soit pour une course ou une partie de basket-ball, ce t-shirt est un ajout polyvalent \\u00e0 votre collection.\",\"en\":\"Upgrade your athletic style with this Sporty Performance T-Shirt. The moisture-wicking fabric and comfortable fit provide support during workouts or sports activities. Whether for a run or a game of basketball, this t-shirt is a versatile addition to your collection.\"}',18.50,'{\"de\":\"Steigern Sie Ihr Training\",\"fr\":\"\\u00c9levez vos entra\\u00eenements\",\"en\":\"Elevate Your Workouts\"}','{\"de\":\"Feuchtigkeitsableitendes Material f\\u00fcr Komfort beim Training.\",\"fr\":\"Tissu \\u00e9vacuant l&#39;humidit\\u00e9 pour plus de confort pendant l&#39;exercice.\",\"en\":\"Moisture-wicking fabric for comfort during exercise.\"}',2,0,162,180,'M-T002',0,230,'{\"url\": \"https://shoptopus.test/sample-store-data/sample-store-1/product-images/mens-t-shirts-2.jpg\", \"file_name\": \"mens-t-shirts-2.jpg\"}',NULL,NULL,'2023-10-25 16:09:49','2023-10-25 16:11:16'),('9a7477f0-8164-446d-9856-1197abb7f283','{\"de\":\"L\\u00e4ssiges T-Shirt mit Rundhalsausschnitt\",\"fr\":\"T-shirt d\\u00e9contract\\u00e9 \\u00e0 col rond\",\"en\":\"Casual Crew Neck T-Shirt\"}','casual-crew-neck-t-shirt','{\"de\":\"Bleiben Sie l\\u00e4ssig und bequem in diesem vielseitigen T-Shirt mit Rundhalsausschnitt.\",\"fr\":\"Restez d\\u00e9contract\\u00e9 et confortable avec ce t-shirt polyvalent \\u00e0 col rond.\",\"en\":\"Stay casual and comfy in this versatile crew neck t-shirt.\"}','{\"de\":\"Finden Sie Komfort in diesem l\\u00e4ssigen T-Shirt mit Rundhalsausschnitt. Das klassische Rundhalsdesign und der vielseitige Stil machen es perfekt f\\u00fcr entspannte Tage. Dieses T-Shirt ist aus weichen, atmungsaktiven Materialien gefertigt und sorgt f\\u00fcr ein angenehmes Tragegef\\u00fchl. Ob f\\u00fcr ein Wochenende zu Hause oder einen entspannten Tagesausflug, es ist ein Muss in Ihrer Garderobe.\",\"fr\":\"Trouvez le confort dans ce t-shirt d\\u00e9contract\\u00e9 \\u00e0 col rond. Le design classique \\u00e0 col rond et le style polyvalent le rendent parfait pour les journ\\u00e9es d\\u00e9contract\\u00e9es. Fabriqu\\u00e9 \\u00e0 partir de mat\\u00e9riaux doux et respirants, ce t-shirt vous assure un confort optimal. Que ce soit pour un week-end \\u00e0 la maison ou une journ\\u00e9e d\\u00e9contract\\u00e9e, c&#39;est un incontournable de votre garde-robe.\",\"en\":\"Find comfort in this Casual Crew Neck T-Shirt. The classic crew neck design and versatile style make it perfect for laid-back days. Crafted from soft, breathable materials, this t-shirt keeps you comfortable. Whether for a weekend at home or a casual day out, it\'s a must-have in your wardrobe.\"}',14.99,'{\"de\":\"L\\u00e4ssiger Komfort\",\"fr\":\"Confort d\\u00e9contract\\u00e9\",\"en\":\"Casual Comfort\"}','{\"de\":\"Vielseitiger Rundhalsausschnitt f\\u00fcr entspannte Tage.\",\"fr\":\"Col rond polyvalent pour des journ\\u00e9es faciles et d\\u00e9contract\\u00e9es.\",\"en\":\"Versatile crew neck for easy and laid-back days.\"}',1,0,588,120,'M-T003',0,240,'{\"url\": \"https://shoptopus.test/sample-store-data/sample-store-1/product-images/mens-t-shirts-3.jpg\", \"file_name\": \"mens-t-shirts-3.jpg\"}',NULL,NULL,'2023-10-25 16:09:50','2023-10-25 16:11:16'),('9a7477f2-28ae-416f-b8ce-8b73a7ff31da','{\"de\":\"Klassisches Hemd\",\"fr\":\"Chemise habill\\u00e9e classique\",\"en\":\"Classic Dress Shirt\"}','classic-dress-shirt','{\"de\":\"Zeitloser Stil in diesem klassischen Hemd.\",\"fr\":\"Style intemporel dans cette chemise habill\\u00e9e classique.\",\"en\":\"Timeless style in this classic dress shirt.\"}','{\"de\":\"Werten Sie Ihren formellen Look mit diesem klassischen Hemd auf. Das zeitlose Design und der hochwertige Stoff machen es perfekt f\\u00fcr jeden besonderen Anlass. Ob f\\u00fcr ein Gesch\\u00e4ftstreffen oder eine formelle Veranstaltung, dieses Hemd bietet sowohl Stil als auch Raffinesse. Erh\\u00e4ltlich in verschiedenen Farben, passend zu Ihrem Ensemble.\",\"fr\":\"Rehaussez votre look formel avec cette chemise habill\\u00e9e classique. Son design intemporel et son tissu de haute qualit\\u00e9 le rendent parfait pour toute occasion sp\\u00e9ciale. Que ce soit pour une r\\u00e9union d&#39;affaires ou un \\u00e9v\\u00e9nement formel, cette chemise habill\\u00e9e offre \\u00e0 la fois style et sophistication. Disponible en diff\\u00e9rentes couleurs pour correspondre \\u00e0 votre ensemble.\",\"en\":\"Elevate your formal look with this Classic Dress Shirt. The timeless design and high-quality fabric make it perfect for any special occasion. Whether for a business meeting or a formal event, this dress shirt offers both style and sophistication. Available in various colors to match your ensemble.\"}',28.99,'{\"de\":\"Zeitlose Eleganz\",\"fr\":\"\\u00c9l\\u00e9gance intemporelle\",\"en\":\"Timeless Elegance\"}','{\"de\":\"Perfekt f\\u00fcr formelle Veranstaltungen und Gesch\\u00e4ftstreffen.\",\"fr\":\"Parfait pour les \\u00e9v\\u00e9nements formels et les r\\u00e9unions d&#39;affaires.\",\"en\":\"Perfect for formal events and business meetings.\"}',2,0,147,160,'M-S001',0,220,'{\"url\": \"https://shoptopus.test/sample-store-data/sample-store-1/product-images/mens-shirt-1.jpg\", \"file_name\": \"mens-shirt-1.jpg\"}',NULL,NULL,'2023-10-25 16:09:51','2023-10-25 16:11:16'),('9a7477f3-ed3d-43f3-970a-4fa01fb81891','{\"de\":\"Business-Freizeithemd\",\"fr\":\"Chemise d\\u00e9contract\\u00e9e d&#39;affaires\",\"en\":\"Business Casual Shirt\"}','business-casual-shirt','{\"de\":\"Werten Sie Ihre B\\u00fcrokleidung mit diesem Business-Freizeithemd auf.\",\"fr\":\"Rehaussez votre tenue de bureau avec cette chemise business casual.\",\"en\":\"Elevate your office attire with this business casual shirt.\"}','{\"de\":\"Werten Sie Ihren professionellen Stil mit diesem Business-Freizeithemd auf. Das moderne Design und die bequeme Passform machen es ideal f\\u00fcr das B\\u00fcro oder Gesch\\u00e4ftstreffen. Ob f\\u00fcr einen Arbeitstag oder eine Firmenveranstaltung, dieses Hemd verleiht Ihrer Garderobe einen Hauch von Eleganz.\",\"fr\":\"Am\\u00e9liorez votre style professionnel avec cette chemise professionnelle d\\u00e9contract\\u00e9e. Son design moderne et sa coupe confortable le rendent id\\u00e9al pour le bureau ou les r\\u00e9unions d&#39;affaires. Que ce soit pour une journ\\u00e9e de travail ou un \\u00e9v\\u00e9nement d&#39;entreprise, cette chemise ajoute une touche de sophistication \\u00e0 votre garde-robe.\",\"en\":\"Upgrade your professional style with this Business Casual Shirt. The modern design and comfortable fit make it ideal for the office or business meetings. Whether for a day at work or a corporate event, this shirt adds a touch of sophistication to your wardrobe.\"}',22.50,'{\"de\":\"Business-Eleganz\",\"fr\":\"\\u00c9l\\u00e9gance commerciale\",\"en\":\"Business Elegance\"}','{\"de\":\"Ideal f\\u00fcr B\\u00fcrokleidung und Firmenveranstaltungen.\",\"fr\":\"Id\\u00e9al pour les tenues de bureau et les \\u00e9v\\u00e9nements d&#39;entreprise.\",\"en\":\"Ideal for office attire and corporate events.\"}',1,0,369,190,'M-S002',0,210,'{\"url\": \"https://shoptopus.test/sample-store-data/sample-store-1/product-images/mens-shirt-2.jpg\", \"file_name\": \"2.jpg\"}',NULL,NULL,'2023-10-25 16:09:52','2023-10-25 16:11:15'),('9a7477f5-8cfb-44d7-b099-c3222c1d589b','{\"de\":\"L\\u00e4ssiges Karohemd\",\"fr\":\"Chemise \\u00e0 carreaux d\\u00e9contract\\u00e9e\",\"en\":\"Casual Checkered Shirt\"}','casual-checkered-shirt','{\"de\":\"Bleiben Sie l\\u00e4ssig und stilvoll mit diesem vielseitigen karierten Hemd.\",\"fr\":\"Restez d\\u00e9contract\\u00e9 et \\u00e9l\\u00e9gant avec cette chemise \\u00e0 carreaux polyvalente.\",\"en\":\"Stay casual and stylish with this versatile checkered shirt.\"}','{\"de\":\"Finden Sie Stil und Komfort in diesem l\\u00e4ssigen karierten Hemd. Das Karomuster und das vielseitige Design machen es perfekt f\\u00fcr l\\u00e4ssige und semi-formelle Anl\\u00e4sse. Dieses aus weichen, atmungsaktiven Materialien gefertigte Shirt sorgt daf\\u00fcr, dass Sie gro\\u00dfartig aussehen. Ob f\\u00fcr einen Wochenendausflug oder ein zwangloses Abendessen, es ist eine vielseitige Erg\\u00e4nzung Ihrer Garderobe.\",\"fr\":\"Trouvez style et confort dans cette chemise \\u00e0 carreaux d\\u00e9contract\\u00e9e. Le motif \\u00e0 carreaux et le design polyvalent le rendent parfait pour les occasions d\\u00e9contract\\u00e9es et semi-formelles. Fabriqu\\u00e9e \\u00e0 partir de mat\\u00e9riaux doux et respirants, cette chemise vous permet de rester belle. Que ce soit pour une sortie du week-end ou un d\\u00eener d\\u00e9contract\\u00e9, c&#39;est un ajout polyvalent \\u00e0 votre garde-robe.\",\"en\":\"Find style and comfort in this Casual Checkered Shirt. The checkered pattern and versatile design make it perfect for both casual and semi-formal occasions. Crafted from soft, breathable materials, this shirt keeps you looking great. Whether for a weekend outing or a casual dinner, it\'s a versatile addition to your wardrobe.\"}',24.99,'{\"de\":\"L\\u00e4ssige Vielseitigkeit\",\"fr\":\"Polyvalence d\\u00e9contract\\u00e9e\",\"en\":\"Casual Versatility\"}','{\"de\":\"Ideal sowohl f\\u00fcr ungezwungene als auch f\\u00fcr semi-formelle Anl\\u00e4sse.\",\"fr\":\"Id\\u00e9al pour les occasions d\\u00e9contract\\u00e9es et semi-formelles.\",\"en\":\"Ideal for both casual and semi-formal occasions.\"}',2,0,147,200,'M-S003',0,225,'{\"url\": \"https://shoptopus.test/sample-store-data/sample-store-1/product-images/mens-shirt-3.jpg\", \"file_name\": \"3.jpg\"}',NULL,NULL,'2023-10-25 16:09:53','2023-10-25 16:11:16'),('9a7477f7-1c74-45c3-93e0-b0bc568265b1','{\"de\":\"Klassisch eleganter Wollpullover\",\"fr\":\"Pull en laine classique et \\u00e9l\\u00e9gant\",\"en\":\"Classic Elegant Wool Jumper\"}','classic-elegant-wool-jumper','{\"de\":\"Zeitlose W\\u00e4rme in diesem klassischen Wollpullover.\",\"fr\":\"Chaleur intemporelle dans ce pull en laine classique.\",\"en\":\"Timeless warmth in this classic wool jumper.\"}','{\"de\":\"Mit diesem klassischen Wollpullover bleiben Sie stilvoll warm. Das zeitlose Design und die hochwertige Wolle machen es perfekt f\\u00fcr k\\u00fchle Tage. Ob f\\u00fcr einen Winterausflug oder einen gem\\u00fctlichen Abend am Kamin, dieser Pullover bietet sowohl W\\u00e4rme als auch Eleganz. Erh\\u00e4ltlich in verschiedenen Farben, ganz nach Ihrem Geschmack.\",\"fr\":\"Restez au chaud avec style avec ce pull en laine classique. Son design intemporel et sa laine de haute qualit\\u00e9 le rendent parfait pour les journ\\u00e9es froides. Que ce soit pour une sortie hivernale ou une soir\\u00e9e douillette au coin du feu, ce pull offre \\u00e0 la fois chaleur et \\u00e9l\\u00e9gance. Disponible en diff\\u00e9rentes couleurs selon vos go\\u00fbts.\",\"en\":\"Stay warm in style with this Classic Wool Jumper. The timeless design and high-quality wool make it perfect for chilly days. Whether for a winter outing or a cozy evening by the fireplace, this jumper offers both warmth and elegance. Available in various colors to suit your taste.\"}',29.99,'{\"de\":\"Zeitlose W\\u00e4rme\",\"fr\":\"Chaleur intemporelle\",\"en\":\"Timeless Warmth\"}','{\"de\":\"Perfekt f\\u00fcr Winterausfl\\u00fcge und gem\\u00fctliche Abende.\",\"fr\":\"Parfait pour les sorties hivernales et les soir\\u00e9es douillettes.\",\"en\":\"Perfect for winter outings and cozy evenings.\"}',1,0,166,180,'M-J001',0,240,'{\"url\": \"https://shoptopus.test/sample-store-data/sample-store-1/product-images/mens-jumpers-1.jpg\", \"file_name\": \"mens-jumpers-1.jpg\"}',NULL,NULL,'2023-10-25 16:09:54','2023-10-25 16:11:16'),('9a7477f8-f3a4-4a28-ab49-b20f28d9bd1e','{\"de\":\"L\\u00e4ssiger, moderner Pullover mit V-Ausschnitt\",\"fr\":\"Pull moderne d\\u00e9contract\\u00e9 \\u00e0 col en V\",\"en\":\"Casual V-Neck Modern Jumper\"}','casual-v-neck-modern-jumper','{\"de\":\"Bleiben Sie l\\u00e4ssig und bequem in diesem vielseitigen Pullover mit V-Ausschnitt.\",\"fr\":\"Restez d\\u00e9contract\\u00e9 et confortable avec ce pull polyvalent \\u00e0 col en V.\",\"en\":\"Stay casual and comfy in this versatile v-neck jumper.\"}','{\"de\":\"Finden Sie Komfort in diesem l\\u00e4ssigen Pullover mit V-Ausschnitt. Das klassische V-Ausschnitt-Design und der vielseitige Stil machen es perfekt f\\u00fcr entspannte Tage. Dieser Pullover ist aus weichen, atmungsaktiven Materialien gefertigt und sorgt f\\u00fcr ein angenehmes Tragegef\\u00fchl. Ob f\\u00fcr ein Wochenende zu Hause oder einen entspannten Tagesausflug, es ist ein Muss in Ihrer Garderobe.\",\"fr\":\"Trouvez le confort dans ce pull d\\u00e9contract\\u00e9 \\u00e0 col en V. Le design classique \\u00e0 col en V et le style polyvalent le rendent parfait pour les journ\\u00e9es d\\u00e9contract\\u00e9es. Fabriqu\\u00e9 \\u00e0 partir de mat\\u00e9riaux